import styled from "styled-components";

export const Box = styled.div`
    height: 100vh;
    width: 100%;
    background-color: black;
    color: white;
    display: flex;
    align-items: center;
    justify-content: center;
`;

export const Logo = styled.img`
    height: 100px;
`;

export const XLogo = styled.img`
    height: 100px;
`
